import React from 'react'
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
// import Home from "./pages/Home"
import Login from "./pages/login/Login"
import Contact from "./pages/Contact"
import PropertyList from "./pages/PropertyList";
import SearchPage from "./pages/SearchPage";
import CardList from "./pages/CardList";
import HomePage from './pages/HomePage';
import { RegisterPage } from './pages/RegisterPage';
import { Propertiespost } from './pages/PropertiesPost';
import { SearchBuyProperties } from './SearchBuyProperties';
import { BudgetSearch } from './BudgetSearch';
import { PropertiesImages } from './PropertiesImages';
import { PropertyListHeader } from 'pages/PropertyListHeader';
import { FlatDetails } from 'pages/FlatDetails';
import Header from 'pages/HomePage/components/Header';
import { FlatDetailsSlider } from 'pages/FlatDetailsSlider';
import { FlatDescription } from 'pages/FlatDescription';
import { FlatAgent } from 'pages/FlatAgent';
import { FlatPrice } from 'pages/FlatPrice';
import { FlatSize } from 'pages/FlatSize';
import { PropertyDeatailsBox } from 'pages/PropertyDetailsBox';
import { OwnerDetailspost } from 'OwnerDeatailsPost';
import { PropertyFeaturesPost } from 'PropertyFeaturesPost';
import { CommercialShopPost } from 'CommercialShopPost';
import { DifferentPropertiesHeader } from 'pages/DifferentPropertiesHeader';
import { PropertySimilarProject } from 'pages/PropertySimilarproject';
import { FlatDetailsSliderBox } from 'pages/FlatDetailSliderBox';


function routes() {
    return (
        <div>
            <Router>
                <Switch>
                <Route path="/header" exact>
                        <Header/>
                    </Route>

                    <Route path="/login" exact>
                        <Login/>
                    </Route>

                    <Route path="/contact" exact>
                        <Contact />
                    </Route>

                    <Route path="/propertylist"   exact>
                        <PropertyList/>
                    </Route>


                    <Route path="/"   exact>
                        <HomePage />
                    </Route>
                    <Route path="/register"   exact>
                        <RegisterPage/>
                    </Route>

                    <Route path="/propertypost"   exact>
                        <Propertiespost/>
                    </Route>


                    {/* <Route path="/budget"   exact>
                        <BudgetSearch/>
                    </Route> */}

                    {/* <Route path="/images"   exact>
                        <PropertiesImages/>
                    </Route> */}


                    {/* <Route path="/propertylistheader"   exact>
                        <PropertyListHeader/>
                    </Route> */}

                    <Route path="/flatdetails"   exact>
                        <FlatDetails/>
                    </Route>

                    {/* <Route path="/flatslider"   exact>
                        <FlatDetailsSlider/>
                    </Route> */}

                    {/* <Route path="/differentpropertiesheader"   exact>
                        <DifferentPropertiesHeader/>
                    </Route> */}

                    {/* <Route path="/flatdescription"   exact>
                        <FlatDescription/>
                    </Route> */}

                    {/* <Route path="/flatagent"   exact>
                        <FlatAgent/>
                    </Route> */}

                    {/* <Route path="/flatprice"   exact>
                        <FlatPrice/>
                    </Route> */}

                    {/* <Route path="/flatsize"   exact>
                        <FlatSize/>
                    </Route> */}

                    {/* <Route path="/propertybox"   exact>
                        <PropertyDeatailsBox/>
                    </Route> */}


                    {/* <Route path="/ownerdetailspost"   exact>
                        <OwnerDetailspost/>
                    </Route> */}

                    {/* <Route path="/propertyfeaturespost"   exact>
                        <PropertyFeaturesPost/>
                    </Route> */}

                    {/* <Route path="/commercialshoppost"   exact>
                        <CommercialShopPost/>
                    </Route>
                     */}
                    {/* <Route path="/propertysimilarproject"   exact>
                        <PropertySimilarProject/>
                    </Route> */}

                    {/* <Route path="/flatdetailboxslider"   exact>
                        <FlatDetailsSliderBox/>
                    </Route> */}



                </Switch>

            </Router>

        </div>
    )
}

export default routes
